/* UM Schedule | (c) 2016 by David Chen | https://stackoverflow.com/users/2344142/dave-chen */
$(document).ready(function() {
    $("#course_code").chosen().change(function() {
        setTimeout(function(){
            $(this).removeClass('chosen-container-active');
            $("#course_name").focus();
        }, 0);
    });
    
    $('#calendar').fullCalendar({
        header: {
            left: '',
            center: 'title',
            right: ''
        },
        columnFormat: 'dddd',
        defaultDate: '2016-01-03',
        editable: false,
        defaultView: 'agendaWeek',
        hiddenDays: [0, 6],
        allDaySlot: false,
        minTime: '8:00',
        maxTime: '19:00',
        height: 'auto',
        titleFormat: '[]',

        eventLimit: false,
        events: []
    });

    var colors = ['F66', 'FFB266', 'FF6', 'B2FF66', '6F6', '66FFB2', '66B2FF', '66F', 'B266FF', 'FF66B2'];
    var used = {};

    var courses = {};
    var adds = ["M", "T", "W", "R", "F"];

    function addEvent(id, title, day, start, end, color) {

        var day = 4 + adds.indexOf(day);
        
        var evt = {
            title: title,
            start: '2016-01-0' + day + 'T' + start,
            end: '2016-01-0' + day + 'T' + end,
            color: color,
            id: id
        };

        $('#calendar').fullCalendar('renderEvent', evt);
    }

    function removeEvent(id) {
        $('#calendar').fullCalendar('removeEvents', id);
    }
    
    function updateRaw() {
        var t = '';
        var hide = true;
        
        for (course in courses)
            if (courses.hasOwnProperty(course)) {
                if (courses[course].lecture != -1)
                    t += courses[course].course + " (LEC) - " + courses[course].lectures[courses[course].lecture].crn + "\n";
                if (courses[course].lab != -1)
                    t += courses[course].course + " (LAB) - " + courses[course].labs[courses[course].lab].crn + "\n";
                hide = false;
            }
            
        if (hide)
            t = "Courses and CRNs are displayed here";
        
        $("#raw").val(t);
    }

    $("#course_name").keyup(function(event) {
        if (event.which == 13)
            $("#add_course").click();
    });

    $("#remove_course").click(function(event) {
        $("#remove_course").attr("disabled", "disabled");

        var name = $("#courses").val();
        colors.push(courses[name].color);
        
        delete courses[name];

        $("#labs").html('<optgroup label="Lab Sections">\
                    <option disabled>Please select a course</option>\
                </optgroup>');

        $("#lectures").html('<optgroup label="Lecture Sections">\
                    <option disabled>Please select a course</option>\
                </optgroup>');

        removeEvent(name + "_lecture");
        removeEvent(name + "_lab");


        updateCourses();
        updateConflicts();
        updateRaw();

    });

    function updateCourses() {
        var html = '<optgroup label="Courses">';
        var hide = true;

        for (course in courses)
            courses.hasOwnProperty(course) &&
            (html += '<option value="' + course + '"> ' + course + " - " + courses[course].title + "</option>", hide = false);

        html += "</optgroup>";

        hide && (html = '<optgroup label="Courses"><option disabled>Courses that you add will appear here</option></optgroup>');
        $("#courses").html(html);
    }

    $("#lectures").change(function(event) {
        var name = $("#courses").val();
        var index = $("#courses option:selected").index();
        var lecture = parseInt($("#lectures").val());
        var c = courses[name].lectures[lecture];
        courses[name].lecture = lecture;
        
        removeEvent(name + "_lecture");

        for (var i = 0, len = c.days.length; i < len; i++)
            addEvent(name + "_lecture",
                     name + " (LECTURE)\n" + c.location + " | " + c.instructor + "\nCRN: " + c.crn,
                     c.days[i],
                     c.begin,
                     c.end,
                     '#' + courses[name].color);
    
        updateConflicts();
        updateRaw();
    });
    
    $("#conflicts").change(function(event) {
        $('#conflicts').val("");
    });

    $("#labs").change(function(event) {
        var name = $("#courses").val();
        var index = $("#courses option:selected").index();
        var lab = parseInt($("#labs").val())
        var c = courses[name].labs[lab];
        courses[name].lab = lab;
        
        removeEvent(name + "_lab");

        for (var i = 0, len = c.days.length; i < len; i++)
            addEvent(name + "_lab",
                     name + " (LAB)\n" + c.location + " | " + c.instructor + "\nCRN: " + c.crn,
                     c.days[i],
                     c.begin,
                     c.end,
                     '#' + courses[name].color);
    
        updateConflicts();
        updateRaw();
    });
    
    function updateConflicts() {
        var html = '<optgroup label="Conflicts">';
        
        var conflicts = findConflicts();
        
        for (var i = 0; i < conflicts.length; i++)
            html += '<option style="background-color:' + conflicts[i].color + '">' + conflicts[i].id.replace('-', ' ').replace('_', ' ') + '</option>';
        
        html += '</optgroup>';
        
        if (conflicts.length == 0)
            html = '<optgroup label="Conflicts"><option disabled>No conflicts</option></optgroup>';
        
        $('#conflicts').html(html);
    }
    
    function removeDuplicates(originalArray, objKey) {
        var trimmedArray = [];
        var values = [];
        var value;

        for (var i = 0; i < originalArray.length; i++) {
            value = originalArray[i][objKey];

            if (values.indexOf(value) === -1) {
                trimmedArray.push(originalArray[i]);
                values.push(value);
            }
        }

        return trimmedArray;

    }
    
    function findConflicts() {
        var overlaps = $('#calendar').fullCalendar('clientEvents', function(first) {
            
            var first_start = new Date(first.start);
            var first_end = new Date(first.end);
            
            var conflicts = $('#calendar').fullCalendar('clientEvents', function(second) {
                var second_start = new Date(second.start);
                var second_end = new Date(second.end);
                
                if (second == first)
                    return false;
                
                return (
                    ( Math.round(second_start) >= Math.round(first_start) && Math.round(second_start) <= Math.round(first_end) )
                    ||
                    ( Math.round(second_end) >= Math.round(first_start) && Math.round(second_end) <= Math.round(first_end) )
                    ||
                    ( Math.round(second_start) <= Math.round(first_start) && Math.round(second_end) >= Math.round(first_end) )
                );
            });
            
            return conflicts.length;
        });
        
        overlaps = removeDuplicates(overlaps, 'id');

        return overlaps;
    }

    $("#courses").change(function(event) {
        $("#remove_course").removeAttr("disabled");
        var c = courses[$("#courses").val()];
        
        for (var e = "", b = 0; b < c.lectures.length; b++)
            e += '<option value="' + b + '">' + c.lectures[b].days + " @ " + c.lectures[b].times + "</option>";
        
        for (var d = "", b = 0; b < c.labs.length; b++)
            d += '<option value="' + b + '">' + c.labs[b].days + " @ " + c.labs[b].times + "</option>";
        
        c.lectures.length == 0 && (e = "<option disabled>This course does not offer any lectures.</option>");
        c.labs.length == 0 && (d = "<option disabled>This course does not require any labs</option>");
        
        $("#lectures").html('<optgroup label="Lecture Sections">' + e + "</optgroup>");
        $("#labs").html('<optgroup label="Lab Sections">' + d + "</optgroup>");
        $("#lectures").val("");
        $("#labs").val("");
        
        c.lecture != -1 && $("#lectures").val(c.lecture);
        c.lab != -1 && $("#labs").val(c.lab);
    });

    $("#add_course").click(function() {
        if ($.trim($("#course_name").val()) != "") {

            var num = 0;
            for (course in courses)
                courses.hasOwnProperty(course) && num++;

            if (num >= 10) {
                alert("A maximum of ten courses per semester is permitted.");
                return;
            }

            $("#add_course").val("Adding...");
            $("#add_course").attr("disabled", "disabled");
            $("#course_name").attr("disabled", "disabled");

            $.getJSON("?id=" + $("#course_code").val() + "&num=" + $("#course_name").val(), function(json) {
                $("#add_course").val("Add course");
                $("#add_course").removeAttr("disabled");
                $("#course_name").removeAttr("disabled");
                $("#course_name").focus();

                if (!json.exists) {
                    alert("That course is not offered at this time.");
                    return;
                }

                $("#course_name").val("");

                if (courses[json.course]) {
                    alert(json.course + " - " + json.title + " has already been added.");
                } else {
                    courses[json.course] = json;
                    courses[json.course].lecture = -1;
                    courses[json.course].lab = -1;
                    courses[json.course].color = colors.pop();

                    updateCourses();
                }
            });
        }
    });

});
